import { Module } from "@nestjs/common";
import { BillResolver } from "./bill.resolver";
import { BillService } from "./bill.service";
let BillModule = class BillModule {
};
BillModule = __decorate([
    Module({
        providers: [BillResolver, BillService],
        exports: [BillService],
    })
], BillModule);
export { BillModule };
